import React from "react";

const Dashboard = () => {

  const linkHandler = () => {
    fetch('http://127.0.0.1:8000/spotify/auth', {
      method: 'GET'
    })
  }

  return (
    <div>
      <h1>Dashboard</h1>
      <a onClick={linkHandler}>
        Link to Spotify
      </a>
    </div>
  )
};

export default Dashboard;
